1	ABOUT	about	<h3><strong>What is Emerald HUB ?</strong></h3>\r\n\r\n<p>Emerald Hub is a coworking space, located in the central of Phnom Penh city, Cambodia, offers students, freelancers, independent individuals, young startups, entrepreneurs, small and growing businesses, service providers and investors the opportunity to work in an innovative, energetic and collaborative workspace. Emerald HUB members can work at shared and dedicated &acirc;&euro;&oelig;desks&acirc;&euro;, or private rooms, complemented with high-speed Wi-Fi Internet and relevant amenities.</p>\r\n\r\n<h3><strong>Vision</strong></h3>\r\n\r\n<p>To build up the best coworking environment in Cambodia for startup, innovative and creative individual, freelancers, entrepreneurs, businesses, investors and communities by providing a platform to learn, share, create, work, connect and grow.</p>\r\n\r\n<h3><strong>What is co-working space?</strong></h3>\r\n\r\n<p>From the wikipedia, coworking is a style of work that involves a shared working environment, often an office, and independent activity. Unlike in a typical office environment, those coworking are usually not employed by the same organization.</p>\r\n\r\n<p>Co-working is when more organizations share a working environment and they may not necessarily be of the same business type. Ultimately, co-working fosters a community of individual organizations with mutual respect for each other&#39;s&#39; businesses.</p>\r\n\r\n<p>Coworking is a growing concept in the Cambodia that is especially popular among freelancer and startup businesses. There are already a number of coworking spaces across the Phnom Penh city and Siem Reap.</p>\r\n\r\n<h3><strong>Why is co-working for you?</strong></h3>\r\n\r\n<p>Coworking does not just allow you to share physical space and facilities, more than that, it gives you a platform where in you can share ideas. It is a better decision to get into coworking not just financially but in terms of the opportunities to learn from each other and the exposure to different business processes. These are the unique benefits that having a coworking set up can give you.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n	2016-07-28 10:33:04.363297	1
