1	អ្នក​ស្រី ជា សុផល្លា តស៊ូ​ពី​បុគ្គលិក​ធម្មតា រហូត​មាន​ក្រុមហ៊ុន៨	<p>ភាព​ជោគជ័យ​របស់​អ្នក​ជំនួញ សុទ្ធតែ​កើត​ចេញ​ពី​ការ​តស៊ូ ព្យាយាម​ឆ្លង​កាត់​ឧបសគ្គ​រាប់​មិន​អស់។ ចំណែក​អ្នក​ស្រី ជា សុផល្លា នាយិកា​ប្រតិបត្តិ​នៃ​ក្រុមហ៊ុន​អចលនទ្រព្យ Emerald+ ក៏​មិន​ខុស​គ្នា​ដែរ គឺ​ចាប់​ផ្ដើម​ដំបូង​ពី​បុគ្គលិក​ធម្មតា​ម្នាក់ រហូត​មាន​ក្រុមហ៊ុន៨ កំពុង​ដំណើរ​ការ​ដល់​សព្វ​ថ្ងៃ។ ​​</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="Chea Sophalla CEO of Emerald+-01" src="http://cdn01.sabay.com/cdn/news.sabay.com.kh/wp-content/uploads/2016/07/Chea-Sophalla-CEO-of-Emerald-01.jpg" style="height:398px; width:600px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ជីវិត​ឯកជន</strong></p>\r\n\r\n<p>អ្នក​ស្រី ជា សុផល្លា មាន​ស្រុក​កំណើត​នៅ​រាជធានី​ភ្នំពេញ​ផ្ទាល់​តែ​ម្ដង ទើប​មាន​អំណោយ​ផល​ស្រាប់​ទាំង​ការ​សិក្សា និង​ការ​ធ្វើ​ជំនួញ។ នៅ​ឆ្នាំ​១៩៩៨ អ្នក​ស្រី បាន​ចាប់​ផ្ដើម​ស្គាល់​បុរស​ម្នាក់​ឈ្មោះ ឈាង សុភក្ដិ និង​មាន​ទំនាក់​ទំនង​ស្វែង​យល់​ចិត្ត​គ្នា ​រហូត​សម្រេច​ចិត្ត​ក្រាប​ផ្ទឹម​រៀប​ការ​តាម​ប្រពៃណី​ទំនៀម​ទម្លាប់​នៅ​ក្នុង​ឆ្នាំ​២០០៦។ ជីវិត​គ្រួសារ​ដ៏​មាន​សុភមង្គល​មួយ​នេះ បង្កើត​បាន​​កូន​ប្រុស​ម្នាក់ និង​ស្រី​ម្នាក់​ជា​ចំណង​ដៃ​រហូត​ដល់​ពេល​បច្ចុប្បន្ន។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="ជា សុផល្លា  (1)" src="http://cdn01.sabay.com/cdn/news.sabay.com.kh/wp-content/uploads/2016/07/%E1%9E%87%E1%9E%B6-%E1%9E%9F%E1%9E%BB%E1%9E%95%E1%9E%9B%E1%9F%92%E1%9E%9B%E1%9E%B6-1.jpg" style="height:381px; width:600px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ការ​សិក្សា</strong></p>\r\n\r\n<p>អ្នក​ស្រី ជា សុផល្លា ធ្លាប់​ឆ្លង​កាត់​បទ​ពិសោធន៍​សិក្សា​ច្រើន មិន​ថា​នៅ​ក្នុង​ប្រទេស ឬ​នៅ​ក្រៅ​ប្រទេស​ឡើយ។ បន្ទាប់​ពី​ជោគជ័យ​លើ​ការ​សិក្សា​បន្ត​បន្ទាប់​តាំង​ពី​កម្រិត​បឋមសិក្សា រហូត​ដល់​បរិញ្ញាបត្រ អ្នក​ស្រី​បាន​បន្ត​បញ្ចប់​ថ្នាក់​អនុបណ្ឌិត​ផ្នែក​គ្រប់​គ្រង​ក្នុង​ឆ្នាំ​២០០៤។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ក្រៅ​ពី​ការ​សិក្សា​ខាង​លើ អ្នក​ស្រី ជា សុផល្លា ក៏​ធ្លាប់​បាន​ឆ្លង​កាត់​វគ្គ​បំប៉ន​ជា​ច្រើន​នៅ​ក្រៅ​ប្រទេស ដូច​ជា​ការ​គ្រប់​គ្រង​អចលនទ្រព្យ Property Management ​នៅ​ប្រទេស​សិង្ហបុរី និង​វគ្គ​សិក្សា​ទាក់​ទង​នឹង​ការ​គ្រប់​គ្រង​គម្រោង Facilities Planning and Project Management ពី​ចក្រភព​អង់គ្លេស ព្រម​ទាំង​វគ្គ​សិក្សា​ក្នុង​ភាព​ជា​អ្នក​ដឹក​នាំ Global Leadership ពី​ប្រទេស​ជប៉ុន។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="ជា សុផល្លា  (2)" src="http://cdn01.sabay.com/cdn/news.sabay.com.kh/wp-content/uploads/2016/07/%E1%9E%87%E1%9E%B6-%E1%9E%9F%E1%9E%BB%E1%9E%95%E1%9E%9B%E1%9F%92%E1%9E%9B%E1%9E%B6-2.jpg" style="height:450px; width:600px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ប្រវត្តិ​ការងារ</strong></p>\r\n\r\n<p>នៅ​ក្នុង​ឆ្នាំ​២០០២ អ្នក​ស្រី ជា សុផល្លា បាន​ចាប់​ផ្ដើម​ធ្វើការ​ជា​ជំនួយ​ការ​គណនេយ្យ​នៅ​ក្រុមហ៊ុន Istana Import &amp; Export ដែល​ជា​ក្រុមហ៊ុន​នាំ​ចូល និង​នាំ​ចេញ​ឡាន​ធំ​ជាង​គេ។ ការ​តស៊ូ និង​ភាព​អំណត់​ក្នុង​ការងារ បាន​ធ្វើ​ឲ្យ​អ្នក​ស្រី​ឡើង​តំណែង​ជា​ប្រធាន​គ្រប់គ្រង​ទូទៅ​នៅ​ក្រុមហ៊ុន​ដដែល។ ប៉ុន្តែ​ដើម្បី​បទ​ពិសោធន៍​ថ្មី​ក្នុង​ជីវិត អ្នក​ស្រី​បាន​សម្រេច​ចិត្ត​លា​ឈប់​ពី​ក្រុមហ៊ុន​ខាង​លើ​ក្នុង​ឆ្នាំ​២០០៦។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>​ពី​ឆ្នាំ២០០៦ ដល់​ឆ្នាំ​២០១៥ ​អ្នក​ស្រី ជា សុផល្លា បាន​ចាប់​ផ្ដើម​ការងារ​បន្ទាប់​ជា​អនុប្រធាន​ផ្នែក​គណនេយ្យ Deputy Finance ​នៅ​ក្រុមហ៊ុន Metfone និង​ឡើង​តួនាទី​ជា​ប្រធាន​ផ្នែក​លក់ Director of Corporate Sale នៅ​ក្រុមហ៊ុន​ដដែល។ ទោះ​យ៉ាង​ណា អ្នក​ស្រី​គិត​ថា​ការ​ធ្វើ​ការ​ឲ្យ​គេ​មិន​អាច​សម​ប្រកប​ចំពោះ​ជីវិត ទើប​សម្រេច​ចិត្ត​លា​ឈប់​ពី​ការងារ​ទាំង​ស្រុង​ក្នុង​ឆ្នាំ​២០១៥ ដើម្បី​ចាប់​ផ្ដើម​ជំនួញ​ពេញ​លេញ។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ការ​បង្កើត​ជំនួញ​ដោយ​ខ្លួន​ឯង</strong></p>\r\n\r\n<p>ការ​ចាប់​ផ្ដើម​រក​ស៊ី​មិន​មែន​ជា​រឿង​ងាយ​ស្រួល​ឡើយ ហើយ​អ្វី​ដែល​ត្រូវ​គិត​ខ្លាំង​បំផុត​គឺ​ដើម​ទុន។ អ្នក​ស្រី ជា សុផល្លា មាន​ដើម​ទុន​ត្រឹម​តែ ៣៥០០០​ដុល្លារ​ប៉ុណ្ណោះ ដើម្បី​ចាប់​ផ្ដើម​បើក​ក្រុមហ៊ុន ហើយ​វា​ជា​ញើស​ឈាម​ដែល​អ្នក​ស្រី​ខំ​សន្សំ​ក្នុង​នាម​ជា​បុគ្គលិក​ធម្មតា​ម្នាក់​អស់​រយៈ​ពេល​ជា​ច្រើន​ឆ្នាំ។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>MOB Corporation គឺ​ជា​ក្រុមហ៊ុន​ដំបូង​របស់​អ្នក​ស្រី ជា សុផល្លា ដែល​បើក​សម្ពោធ​ក្នុង​ឆ្នាំ​២០១៣។ នៅ​ក្នុង​ឆ្នាំ២០១៤ អ្នក​ស្រី ជា សុផល្លា បាន​ចាប់​ផ្ដើម​ក្រុមហ៊ុន ២​ទៀត ក្នុង​នាម​ជា​ដៃ​គូ គឺ 360 Ads &amp; Event Management និង 360 Printing ដែល​ទទួល​បាន​ជោគ​ជ័យ​បន្ត​បន្ទាប់ ធ្វើ​ឲ្យ​អ្នក​ស្រី​មាន​ដើម​ទុន​ច្រើន​បង្គួរ។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>នៅ​ឆ្នាំ​២០១៥ សហគ្រិន​នារី​រូប​នេះ បាន​ចាប់​ផ្ដើម​ក្រុមហ៊ុន Emerald+ Property ដែល​ជា​ក្រុមហ៊ុន​ចំណាយ​ដើម​ទុន​ធំ​បំផុត​ក្នុង​ចំណោម​ក្រុមហ៊ុន​ទាំង​អស់។ បន្ទាប់​មក​ក្នុង​ឆ្នាំ​​ដដែល អ្នក​ស្រី ជា សុផល្លា បាន​ចាប់​ផ្ដើម​បើក​ហាង The Place Salon Spa មួយ​ទៀត ព្រម​ទាំង​ចាប់​ផ្ដើម​ជា​ដៃគូ​សហការ​បើក​ក្រុមហ៊ុន Emerald Hub។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ភាព​ជោគជ័យ​លើ​ក្រុមហ៊ុន​ទាំង ៦​ខាង​លើ បាន​ធ្វើ​អ្នក​ស្រី ជា សុផល្លា ចាប់​ផ្ដើម​បើក​ក្រុមហ៊ុន Emerald Architecture and Land Scaping ព្រម​ទាំង​ចាប់​ផ្ដើម​ភាព​ជា​ដៃគូ​ក្នុង​ការ​បើក​ក្រុមហ៊ុន Battambong Restaurant &amp; Bar ក្នុង​ឆ្នាំ​២០១៦ នេះ​ទៀត។ សរុប​ក្រុមហ៊ុន​ទាំង៨ កំពុង​ដំណើរការ​ជា​ធម្មតា។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="ជា សុផល្លា  (4)" src="http://cdn02.sabay.com/cdn/news.sabay.com.kh/wp-content/uploads/2016/07/%E1%9E%87%E1%9E%B6-%E1%9E%9F%E1%9E%BB%E1%9E%95%E1%9E%9B%E1%9F%92%E1%9E%9B%E1%9E%B6-4.jpg" style="height:376px; width:600px" /></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>ជោគជ័យ​ខ្លាំង​ទទួល​បាន​ពាន៣ ក្នុង​ឆ្នាំ​២០១៦</strong></p>\r\n\r\n<p>លោក​ស្រី ជា សុផល្លា ជា​ស្ត្រី​ខ្មែរ​ម្នាក់​ក្នុង​ចំណោម​ស្ត្រី​ខ្មែរ ១០ នាក់​ផ្សេង​ទៀត ដែល​បាន​ទទួល​ពាន Outstanding ASEAN Women Entrepreneur Award ពី​កម្មវិធី ASEAN WOMEN ENTERPRENEURS FORUM លើក​ទី ២ ឆ្នាំ ​២០១៦ នៅ​ទីក្រុង​ហាណូយ ប្រទេស​វៀតណាម។ ការ​ទទួល​បាន​ពាន​រង្វាន់​នេះ គឺ​ដោយសារ​​អ្នក​ស្រី ជា សុផល្លា មាន​បទពិសោធន៍​ច្រើន​ឆ្នាំ​ក្នុង​វិស័យ​ជំនួញ ព្រម​ទាំង​មាន​ឯកសារ​ទាក់ទង​ហិរញ្ញវត្ថុ សញ្ញាប័ត្រ ការងារ​សង្គម​គ្រប់​គ្រាន់ បូក​រួម​ទាំង​ការងារ​លើក​កម្ពស់​​ស្ត្រី​ជា​ដើម។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>កាល​ពី​ចុង​ខែ​មិថុនា​កន្លង​ទៅ អ្នក​ស្រី ជា សុផល្លា បាន​​ទទួល​ពាន​រង្វាន់ ២​ទៀត​ពី​សមាគម Socrates នៅ​ប្រទេស​អាល្លឺម៉ង់។ ពាន​រង្វាន់​ទាំង២ នោះ​គឺ Best Enterprise សម្រាប់​ក្រុមហ៊ុន​ពី​ប្រទេស​កម្ពុជា​ និង Manager of the year ជា​លក្ខណៈ​បុគ្គល។ កម្មវិធី​នេះ​ត្រូវ​បាន​រៀប​ចំ​ឡើង​ដោយ​មាន​ការ​សហការ​ពី​បណ្ដា​ប្រទេស​ ចំនួន២៦ នៅ​លើ​ពិភពលោក​ដើម្បី​ចែក​រំលែក​បទពិសោធន៍ និង​រៀន​បន្ថែម​ពី​គ្នា​ទៅ​វិញ​ទៅ​មក។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ក្នុង​បទ​សម្ភាសន៍​ជាមួយ Sabay លោក​ស្រី ជា សុផល្លា បាន​រៀបរាប់​ថា ការ​អញ្ជើញ​ឲ្យ​ទៅ​ចូល​រួម​កម្មវិធី​ប្រគល់​ពាន​រង្វាន់​របស់​សមាគម Socrates នៅ​ទីក្រុង BAD EMS ប្រទេស​អាល្លឺម៉ង់ គឺ​ជា​រឿង​នឹក​ស្មាន​មិន​ដល់ ព្រោះ​លោក​ស្រី​មិន​ធ្លាប់​មាន​ទំនាក់​ទំនង​ជាមួយ​សមាគម​នេះ​ទេ​ពី​មុន​មក។ លោក​ស្រី​បាន​បន្ថែម​ទៀត​ថា សហគ្រិន​បរទេស​ដែល​ចូលរួម​កម្ម​វិធី​ខាង​លើ មាន​ការ​ភ្ញាក់​ផ្អើល​ខ្លាំង​បន្ទាប់​ពី​លោក​ស្រី​បាន​ធ្វើ​បទ​បង្ហាញ​ពី​ក្រុមហ៊ុន ក៏​ដូច​ជា​ប្រទេស​កម្ពុជា​ផ្ទាល់។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="Woman4" src="http://cdn01.sabay.com/cdn/news.sabay.com.kh/wp-content/uploads/2016/07/Woman41.jpg" style="height:346px; width:600px" /></p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p><strong>មេរៀន​ជីវិត</strong></p>\r\n\r\n<p>បើ​និយាយ​ទៅ ក្នុង​ឆាក​ជីវិត​របស់​អ្នក​ស្រី ជា សុផល្លា ភាគ​ច្រើន​ទទួល​បាន​ជោគ​ជ័យ គ្មាន​ពាក្យ​ថា​បរាជ័យ​ជា​ដុំ​កំភួន​ឡើយ ព្រោះ​អ្នក​ស្រី​តែង​តែ​យក​ការ​ព្យាយាម​ដាក់​ខ្លួន​ជា​និច្ច។ អាច​ចាត់​ទុក​ថា​ជា​មនុស្ស​មាន​សំណាង​ម្នាក់ ព្រោះ​ទាំង​ការ​សិក្សា ទាំង​ការងារ ជំនួញ និង​គ្រួសារ មិន​ទាន់​មាន​បរាជ័យ ដែល​អាច​រាប់​បាន​ថា​ជា​មេរៀន​ជីវិត​ឡើយ។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>យ៉ាង​ណា​ក្ដី អ្នក​ស្រី ជា សុផល្លា បាន​បញ្ជាក់​ថា ធ្លាប់​ឆ្លង​កាត់​ការ​លំបាក​ច្រើន ក្នុង​នាម​ជា​ស្ត្រី​ម្នាក់​ដែល​ដាក់​ចិត្ត​លើ​ជំនួញ។ អ្នក​ស្រី ត្រូវ​ធ្វើ​កិច្ចការ​គ្រប់​យ៉ាង​ដែល​មនុស្ស​ប្រុស​ធ្វើ ព្រោះ​ដើម្បី​ជោគជ័យ​មុន​ក្លាយ​ជា​សហគ្រិន​ម្នាក់។ ការ​ព្យាយាម​ដើរ​តួនាទី​ជា​មេ​ផង ជា​កូន​ចៅ​ផង គឺ​អ្នក​ស្រី​ធ្លាប់​ឆ្លង​កាត់​ទាំង​អស់។</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>ជា​សហគ្រិន​ធ្លាប់​ឆ្លង​កាត់​បទ​ពិសោធន៍​ច្រើន អ្នក​ស្រី ជា សុផល្លា បាន​បង្ហាញ​ផ្លូវ​ឲ្យ​អ្នក​ចង់​ចាប់​ផ្ដើម​ជំនួញ​ក្រោយ​ៗ​ទៀត គិត​ខ្លាំង​ទៅ​លើ​ដើម​ទុន ព្រោះ​វា​ពិត​ជា​មាន​សារសំខាន់​ខ្លាំង​ណាស់។ លើស​ពី​នេះ ត្រូវ​មាន​ភាព​ជឿ​ជាក់​ទៅ​លើ​ដៃគូ ទើប​អាច​ដំណើរ​ការ​រលូន​ទៅ​មុខ។ ចំណែក​ការ​តស៊ូ​ពិត​ជា​មិន​អាច​រំលង​បាន​ឡើយ ព្រោះ​វា​ហាក់​ដូច​ជា​ក្បូន​រុញ​ច្រាន​ទូក​លើ​ជល​សា​ឲ្យ​លឿន​លយ​ឲ្យ​ទៅ​មុខ​យ៉ាង​ដូច្នោះ​ដែរ៕</p>\r\n	data:image/jpeg;base64,		1	1	2016-07-28 12:06:45.444423	0
2	Want to start a startup?	<p>You need three things to create a successful startup: to start with good people, to make something customers actually want, and to spend as little money as possible. Most startups that fail do it because they fail at one of these. A startup that does all three will probably succeed.<br />\r\n<br />\r\nAnd that&#39;s kind of exciting, when you think about it, because all three are doable. Hard, but doable. And since a startup that succeeds ordinarily makes its founders rich, that implies getting rich is doable too. Hard, but doable.<br />\r\n<br />\r\nIf there is one message I&#39;d like to get across about startups, that&#39;s it. There is no magically difficult step that requires brilliance to solve.<br />\r\n<br />\r\n<strong>The Idea</strong><br />\r\n<br />\r\nIn particular, you don&#39;t need a brilliant&nbsp;<a href="http://paulgraham.com/ideas.html">idea</a>&nbsp;to start a startup around. The way a startup makes money is to offer people better technology than they have now. But what people have now is often so bad that it doesn&#39;t take brilliance to do better.<br />\r\n<br />\r\nGoogle&#39;s plan, for example, was simply to create a search site that didn&#39;t suck. They had three new ideas: index more of the Web, use links to rank search results, and have clean, simple web pages with unintrusive keyword-based ads. Above all, they were determined to make a site that was good to use. No doubt there are great technical tricks within Google, but the overall plan was straightforward. And while they probably have bigger ambitions now, this alone brings them a billion dollars a year. [1]<br />\r\n<br />\r\nThere are plenty of other areas that are just as backward as search was before Google. I can think of several heuristics for generating ideas for startups, but most reduce to this: look at something people are trying to do, and figure out how to do it in a way that doesn&#39;t suck.<br />\r\n<br />\r\nFor example, dating sites currently suck far worse than search did before Google. They all use the same simple-minded model. They seem to have approached the problem by thinking about how to do database matches instead of how dating works in the real world. An undergrad could build something better as a class project. And yet there&#39;s a lot of money at stake. Online dating is a valuable business now, and it might be worth a hundred times as much if it worked.<br />\r\n<br />\r\nAn idea for a startup, however, is only a beginning. A lot of would-be startup founders think the key to the whole process is the initial idea, and from that point all you have to do is execute. Venture capitalists know better. If you go to VC firms with a brilliant idea that you&#39;ll tell them about if they sign a nondisclosure agreement, most will tell you to get lost. That shows how much a mere idea is worth. The market price is less than the inconvenience of signing an NDA.<br />\r\n<br />\r\nAnother sign of how little the initial idea is worth is the number of startups that change their plan en route. Microsoft&#39;s original plan was to make money selling programming languages, of all things. Their current business model didn&#39;t occur to them until IBM dropped it in their lap five years later.<br />\r\n<br />\r\nIdeas for startups are worth something, certainly, but the trouble is, they&#39;re not transferrable. They&#39;re not something you could hand to someone else to execute. Their value is mainly as starting points: as questions for the people who had them to continue thinking about.<br />\r\n<br />\r\nWhat matters is not ideas, but the people who have them. Good people can fix bad ideas, but good ideas can&#39;t save bad people.&nbsp;<br />\r\n<br />\r\n<strong>People</strong><br />\r\n<br />\r\nWhat do I mean by good people? One of the best tricks I learned during&nbsp;<a href="http://paulgraham.com/road.html">our</a>&nbsp;startup was a rule for deciding who to hire. Could you describe the person as an animal? It might be hard to translate that into another language, but I think everyone in the US knows what it means. It means someone who takes their work a little too seriously; someone who does what they do so well that they pass right through professional and cross over into obsessive.<br />\r\n<br />\r\nWhat it means specifically depends on the job: a salesperson who just won&#39;t take no for an answer; a hacker who will stay up till 4:00 AM rather than go to bed leaving code with a bug in it; a PR person who will cold-call&nbsp;<em>New York Times</em>&nbsp;reporters on their cell phones; a graphic designer who feels physical pain when something is two millimeters out of place.<br />\r\n<br />\r\nAlmost everyone who worked for us was an animal at what they did. The woman in charge of sales was so tenacious that I used to feel sorry for potential customers on the phone with her. You could sense them squirming on the hook, but you knew there would be no rest for them till they&#39;d signed up.<br />\r\n<br />\r\nIf you think about people you know, you&#39;ll find the animal test is easy to apply. Call the person&#39;s image to mind and imagine the sentence &quot;so-and-so is an animal.&quot; If you laugh, they&#39;re not. You don&#39;t need or perhaps even want this quality in big companies, but you need it in a startup.<br />\r\n<br />\r\nFor programmers we had three additional tests. Was the person genuinely smart? If so, could they actually get things done? And finally, since a few good hackers have unbearable personalities, could we stand to have them around?<br />\r\n<br />\r\nThat last test filters out surprisingly few people. We could bear any amount of nerdiness if someone was truly smart. What we couldn&#39;t stand were people with a lot of attitude. But most of those weren&#39;t truly smart, so our third test was largely a restatement of the first.<br />\r\n<br />\r\nWhen nerds are unbearable it&#39;s usually because they&#39;re trying too hard to seem smart. But the smarter they are, the less pressure they feel to act smart. So as a rule you can recognize genuinely smart people by their ability to say things like &quot;I don&#39;t know,&quot; &quot;Maybe you&#39;re right,&quot; and &quot;I don&#39;t understand x well enough.&quot;<br />\r\n<br />\r\nThis technique doesn&#39;t always work, because people can be influenced by their environment. In the MIT CS department, there seems to be a tradition of acting like a brusque know-it-all. I&#39;m told it derives ultimately from Marvin Minsky, in the same way the classic airline pilot manner is said to derive from Chuck Yeager. Even genuinely smart people start to act this way there, so you have to make allowances.<br />\r\n<br />\r\nIt helped us to have Robert Morris, who is one of the readiest to say &quot;I don&#39;t know&quot; of anyone I&#39;ve met. (At least, he was before he became a professor at MIT.) No one dared put on attitude around Robert, because he was obviously smarter than they were and yet had zero attitude himself.<br />\r\n<br />\r\nLike most startups, ours began with a group of friends, and it was through personal contacts that we got most of the people we hired. This is a crucial difference between startups and big companies. Being friends with someone for even a couple days will tell you more than companies could ever learn in interviews. [2]<br />\r\n<br />\r\nIt&#39;s no coincidence that startups start around universities, because that&#39;s where smart people meet. It&#39;s not what people learn in classes at MIT and Stanford that has made technology companies spring up around them. They could sing campfire songs in the classes so long as admissions worked the same.<br />\r\n<br />\r\nIf you start a startup, there&#39;s a good chance it will be with people you know from college or grad school. So in theory you ought to try to make friends with as many smart people as you can in school, right? Well, no. Don&#39;t make a conscious effort to schmooze; that doesn&#39;t work well with hackers.<br />\r\n<br />\r\nWhat you should do in college is work on your own projects. Hackers should do this even if they don&#39;t plan to start startups, because it&#39;s the only real way to learn how to program. In some cases you may collaborate with other students, and this is the best way to get to know good hackers. The project may even grow into a startup. But once again, I wouldn&#39;t aim too directly at either target. Don&#39;t force things; just work on stuff you like with people you like.<br />\r\n<br />\r\nIdeally you want between two and four founders. It would be hard to start with just one. One person would find the moral weight of starting a company hard to bear. Even Bill Gates, who seems to be able to bear a good deal of moral weight, had to have a co-founder. But you don&#39;t want so many founders that the company starts to look like a group photo. Partly because you don&#39;t need a lot of people at first, but mainly because the more founders you have, the worse disagreements you&#39;ll have. When there are just two or three founders, you know you have to resolve disputes immediately or perish. If there are seven or eight, disagreements can linger and harden into factions. You don&#39;t want mere voting; you need unanimity.<br />\r\n<br />\r\nIn a technology startup, which most startups are, the founders should include technical people. During the Internet Bubble there were a number of startups founded by business people who then went looking for hackers to create their product for them. This doesn&#39;t work well. Business people are bad at deciding what to do with technology, because they don&#39;t know what the options are, or which kinds of problems are hard and which are easy. And when business people try to hire hackers, they can&#39;t tell which ones are&nbsp;<a href="http://paulgraham.com/gh.html">good</a>. Even other hackers have a hard time doing that. For business people it&#39;s roulette.<br />\r\n<br />\r\nDo the founders of a startup have to include business people? That depends. We thought so when we started ours, and we asked several people who were said to know about this mysterious thing called &quot;business&quot; if they would be the president. But they all said no, so I had to do it myself. And what I discovered was that business was no great mystery. It&#39;s not something like physics or medicine that requires extensive study. You just try to get people to pay you for stuff.<br />\r\n<br />\r\nI think the reason I made such a mystery of business was that I was disgusted by the idea of doing it. I wanted to work in the pure, intellectual world of software, not deal with customers&#39; mundane problems. People who don&#39;t want to get dragged into some kind of work often develop a protective incompetence at it. Paul Erdos was particularly good at this. By seeming unable even to cut a grapefruit in half (let alone go to the store and buy one), he forced other people to do such things for him, leaving all his time free for math. Erdos was an extreme case, but most husbands use the same trick to some degree.<br />\r\n<br />\r\nOnce I was forced to discard my protective incompetence, I found that business was neither so hard nor so boring as I feared. There are esoteric areas of business that are quite hard, like tax law or the pricing of derivatives, but you don&#39;t need to know about those in a startup. All you need to know about business to run a startup are commonsense things people knew before there were business schools, or even universities.<br />\r\n<br />\r\nIf you work your way down the Forbes 400 making an x next to the name of each person with an MBA, you&#39;ll learn something important about business school. After Warren Buffett, you don&#39;t hit another MBA till number 22, Phil Knight, the CEO of Nike. There are only 5 MBAs in the top 50. What you notice in the Forbes 400 are a lot of people with technical backgrounds. Bill Gates, Steve Jobs, Larry Ellison, Michael Dell, Jeff Bezos, Gordon Moore. The rulers of the technology business tend to come from technology, not business. So if you want to invest two years in something that will help you succeed in business, the evidence suggests you&#39;d do better to learn how to hack than get an MBA. [3]<br />\r\n<br />\r\nThere is one reason you might want to include business people in a startup, though: because you have to have at least one person willing and able to focus on what customers want. Some believe only business people can do this-- that hackers can implement software, but not design it. That&#39;s nonsense. There&#39;s nothing about knowing how to program that prevents hackers from understanding users, or about not knowing how to program that magically enables business people to understand them.<br />\r\n<br />\r\nIf you can&#39;t understand users, however, you should either learn how or find a co-founder who can. That is the single most important issue for technology startups, and the rock that sinks more of them than anything else.<br />\r\n<br />\r\n<strong>What Customers Want</strong><br />\r\n<br />\r\nIt&#39;s not just startups that have to worry about this. I think most businesses that fail do it because they don&#39;t give customers what they want. Look at restaurants. A large percentage fail, about a quarter in the first year. But can you think of one restaurant that had really good food and went out of business?<br />\r\n<br />\r\nRestaurants with great food seem to prosper no matter what. A restaurant with great food can be expensive, crowded, noisy, dingy, out of the way, and even have bad service, and people will keep coming. It&#39;s true that a restaurant with mediocre food can sometimes attract customers through gimmicks. But that approach is very risky. It&#39;s more straightforward just to make the food good.<br />\r\n<br />\r\nIt&#39;s the same with technology. You hear all kinds of reasons why startups fail. But can you think of one that had a massively popular product and still failed?<br />\r\n<br />\r\nIn nearly every failed startup, the real problem was that customers didn&#39;t want the product. For most, the cause of death is listed as &quot;ran out of funding,&quot; but that&#39;s only the immediate cause. Why couldn&#39;t they get more funding? Probably because the product was a dog, or never seemed likely to be done, or both.<br />\r\n<br />\r\nWhen I was trying to think of the things every startup needed to do, I almost included a fourth: get a version 1 out as soon as you can. But I decided not to, because that&#39;s implicit in making something customers want. The only way to make something customers want is to get a prototype in front of them and refine it based on their reactions.<br />\r\n<br />\r\nThe other approach is what I call the &quot;Hail Mary&quot; strategy. You make elaborate plans for a product, hire a team of engineers to develop it (people who do this tend to use the term &quot;engineer&quot; for hackers), and then find after a year that you&#39;ve spent two million dollars to develop something no one wants. This was not uncommon during the Bubble, especially in companies run by business types, who thought of software development as something terrifying that therefore had to be carefully planned.<br />\r\n<br />\r\nWe never even considered that approach. As a Lisp hacker, I come from the tradition of rapid prototyping. I would not claim (at least, not here) that this is the right way to write every program, but it&#39;s certainly the right way to write software for a startup. In a startup, your initial plans are almost certain to be wrong in some way, and your first priority should be to figure out where. The only way to do that is to try implementing them.<br />\r\n<br />\r\nLike most startups, we changed our plan on the fly. At first we expected our customers to be Web consultants. But it turned out they didn&#39;t like us, because our software was easy to use and we hosted the site. It would be too easy for clients to fire them. We also thought we&#39;d be able to sign up a lot of catalog companies, because selling online was a natural extension of their existing business. But in 1996 that was a hard sell. The middle managers we talked to at catalog companies saw the Web not as an opportunity, but as something that meant more work for them.<br />\r\n<br />\r\nWe did get a few of the more adventurous catalog companies. Among them was Frederick&#39;s of Hollywood, which gave us valuable experience dealing with heavy loads on our servers. But most of our users were small, individual merchants who saw the Web as an opportunity to build a business. Some had retail stores, but many only existed online. And so we changed direction to focus on these users. Instead of concentrating on the features Web consultants and catalog companies would want, we worked to make the software easy to use.<br />\r\n<br />\r\nI learned something valuable from that. It&#39;s worth trying very, very hard to make technology easy to use. Hackers are so used to computers that they have no idea how horrifying software seems to normal people. Stephen Hawking&#39;s editor told him that every equation he included in his book would cut sales in half. When you work on making technology easier to use, you&#39;re riding that curve up instead of down. A 10% improvement in ease of use doesn&#39;t just increase your sales 10%. It&#39;s more likely to double your sales.<br />\r\n<br />\r\nHow do you figure out what customers want? Watch them. One of the best places to do this was at trade shows. Trade shows didn&#39;t pay as a way of getting new customers, but they were worth it as market research. We didn&#39;t just give canned presentations at trade shows. We used to show people how to build real, working stores. Which meant we got to watch as they used our software, and talk to them about what they needed.<br />\r\n<br />\r\nNo matter what kind of startup you start, it will probably be a stretch for you, the founders, to understand what users want. The only kind of software you can build without studying users is the sort for which you are the typical user. But this is just the kind that tends to be open source: operating systems, programming languages, editors, and so on. So if you&#39;re developing technology for money, you&#39;re probably not going to be developing it for people like you. Indeed, you can use this as a way to generate ideas for startups: what do people who are not like you want from technology?<br />\r\n<br />\r\nWhen most people think of startups, they think of companies like Apple or Google. Everyone knows these, because they&#39;re big consumer brands. But for every startup like that, there are twenty more that operate in niche markets or live quietly down in the infrastructure. So if you start a successful startup, odds are you&#39;ll start one of those.<br />\r\n<br />\r\nAnother way to say that is, if you try to start the kind of startup that has to be a big consumer brand, the odds against succeeding are steeper. The best odds are in niche markets. Since startups make money by offering people something better than they had before, the best opportunities are where things suck most. And it would be hard to find a place where things suck more than in corporate IT departments. You would not believe the amount of money companies spend on software, and the crap they get in return. This imbalance equals opportunity.<br />\r\n<br />\r\nIf you want ideas for startups, one of the most valuable things you could do is find a middle-sized non-technology company and spend a couple weeks just watching what they do with computers. Most good hackers have no more idea of the horrors perpetrated in these places than rich Americans do of what goes on in Brazilian slums.<br />\r\n<br />\r\nStart by writing software for smaller companies, because it&#39;s easier to sell to them. It&#39;s worth so much to sell stuff to big companies that the people selling them the crap they currently use spend a lot of time and money to do it. And while you can outhack Oracle with one frontal lobe tied behind your back, you can&#39;t outsell an Oracle salesman. So if you want to win through better technology, aim at smaller customers. [4]<br />\r\n<br />\r\nThey&#39;re the more strategically valuable part of the market anyway. In technology, the low end always eats the high end. It&#39;s easier to make an inexpensive product more powerful than to make a powerful product cheaper. So the products that start as cheap, simple options tend to gradually grow more powerful till, like water rising in a room, they squash the &quot;high-end&quot; products against the ceiling. Sun did this to mainframes, and Intel is doing it to Sun. Microsoft Word did it to desktop publishing software like Interleaf and Framemaker. Mass-market digital cameras are doing it to the expensive models made for professionals. Avid did it to the manufacturers of specialized video editing systems, and now Apple is doing it to Avid.&nbsp;<em>Henry Ford</em>&nbsp;did it to the car makers that preceded him. If you build the simple, inexpensive option, you&#39;ll not only find it easier to sell at first, but you&#39;ll also be in the best position to conquer the rest of the market.<br />\r\n<br />\r\nIt&#39;s very dangerous to let anyone fly under you. If you have the cheapest, easiest product, you&#39;ll own the low end. And if you don&#39;t, you&#39;re in the crosshairs of whoever does.<br />\r\n<br />\r\n<strong>Raising Money</strong><br />\r\n<br />\r\nTo make all this happen, you&#39;re going to need money. Some startups have been self-funding-- Microsoft for example-- but most aren&#39;t. I think it&#39;s wise to take money from investors. To be self-funding, you have to start as a consulting company, and it&#39;s hard to switch from that to a product company.<br />\r\n<br />\r\nFinancially, a startup is like a pass/fail course. The way to get rich from a startup is to maximize the company&#39;s chances of succeeding, not to maximize the amount of stock you retain. So if you can trade stock for something that improves your odds, it&#39;s probably a smart move.<br />\r\n<br />\r\nTo most hackers, getting investors seems like a terrifying and mysterious process. Actually it&#39;s merely tedious. I&#39;ll try to give an outline of how it works.<br />\r\n<br />\r\nThe first thing you&#39;ll need is a few tens of thousands of dollars to pay your expenses while you develop a prototype. This is called seed capital. Because so little money is involved, raising seed capital is comparatively easy-- at least in the sense of getting a quick yes or no.<br />\r\n<br />\r\nUsually you get seed money from individual rich people called &quot;angels.&quot; Often they&#39;re people who themselves got rich from technology. At the seed stage, investors don&#39;t expect you to have an elaborate business plan. Most know that they&#39;re supposed to decide quickly. It&#39;s not unusual to get a check within a week based on a half-page agreement.<br />\r\n<br />\r\nWe started Viaweb with $10,000 of seed money from our friend Julian. But he gave us a lot more than money. He&#39;s a former CEO and also a corporate lawyer, so he gave us a lot of valuable advice about business, and also did all the legal work of getting us set up as a company. Plus he introduced us to one of the two angel investors who supplied our next round of funding.<br />\r\n<br />\r\nSome angels, especially those with technology backgrounds, may be satisfied with a demo and a verbal description of what you plan to do. But many will want a copy of your business plan, if only to remind themselves what they invested in.<br />\r\n<br />\r\nOur angels asked for one, and looking back, I&#39;m amazed how much worry it caused me. &quot;Business plan&quot; has that word &quot;business&quot; in it, so I figured it had to be something I&#39;d have to read a book about business plans to write. Well, it doesn&#39;t. At this stage, all most investors expect is a brief description of what you plan to do and how you&#39;re going to make money from it, and the resumes of the founders. If you just sit down and write out what you&#39;ve been saying to one another, that should be fine. It shouldn&#39;t take more than a couple hours, and you&#39;ll probably find that writing it all down gives you more ideas about what to do.<br />\r\n<br />\r\nFor the angel to have someone to make the check out to, you&#39;re going to have to have some kind of company. Merely incorporating yourselves isn&#39;t hard. The problem is, for the company to exist, you have to decide who the founders are, and how much stock they each have. If there are two founders with the same qualifications who are both equally committed to the business, that&#39;s easy. But if you have a number of people who are expected to contribute in varying degrees, arranging the proportions of stock can be hard. And once you&#39;ve done it, it tends to be set in stone.<br />\r\n<br />\r\nI have no tricks for dealing with this problem. All I can say is, try hard to do it right. I do have a rule of thumb for recognizing when you have, though. When everyone feels they&#39;re getting a slightly bad deal, that they&#39;re doing more than they should for the amount of stock they have, the stock is optimally apportioned.<br />\r\n<br />\r\nThere is more to setting up a company than incorporating it, of course: insurance, business license, unemployment compensation, various things with the IRS. I&#39;m not even sure what the list is, because we, ah, skipped all that. When we got real funding near the end of 1996, we hired a great CFO, who fixed everything retroactively. It turns out that no one comes and arrests you if you don&#39;t do everything you&#39;re supposed to when starting a company. And a good thing too, or a lot of startups would never get started. [5]<br />\r\n<br />\r\nIt can be dangerous to delay turning yourself into a company, because one or more of the founders might decide to split off and start another company doing the same thing. This does happen. So when you set up the company, as well as as apportioning the stock, you should get all the founders to sign something agreeing that everyone&#39;s ideas belong to this company, and that this company is going to be everyone&#39;s only job.<br />\r\n<br />\r\n[If this were a movie, ominous music would begin here.]<br />\r\n<br />\r\nWhile you&#39;re at it, you should ask what else they&#39;ve signed. One of the worst things that can happen to a startup is to run into intellectual property problems. We did, and it came closer to killing us than any competitor ever did.<br />\r\n<br />\r\nAs we were in the middle of getting bought, we discovered that one of our people had, early on, been bound by an agreement that said all his ideas belonged to the giant company that was paying for him to go to grad school. In theory, that could have meant someone else owned big chunks of our software. So the acquisition came to a screeching halt while we tried to sort this out. The problem was, since we&#39;d been about to be acquired, we&#39;d allowed ourselves to run low on cash. Now we needed to raise more to keep going. But it&#39;s hard to raise money with an IP cloud over your head, because investors can&#39;t judge how serious it is.<br />\r\n<br />\r\nOur existing investors, knowing that we needed money and had nowhere else to get it, at this point attempted certain gambits which I will not describe in detail, except to remind readers that the word &quot;angel&quot; is a metaphor. The founders thereupon proposed to walk away from the company, after giving the investors a brief tutorial on how to administer the servers themselves. And while this was happening, the acquirers used the delay as an excuse to welch on the deal.<br />\r\n<br />\r\nMiraculously it all turned out ok. The investors backed down; we did another round of funding at a reasonable valuation; the giant company finally gave us a piece of paper saying they didn&#39;t own our software; and six months later we were bought by Yahoo for much more than the earlier acquirer had agreed to pay. So we were happy in the end, though the experience probably took several years off my life.<br />\r\n<br />\r\nDon&#39;t do what we did. Before you consummate a startup, ask everyone about their previous IP history.<br />\r\n<br />\r\nOnce you&#39;ve got a company set up, it may seem presumptuous to go knocking on the doors of rich people and asking them to invest tens of thousands of dollars in something that is really just a bunch of guys with some ideas. But when you look at it from the rich people&#39;s point of view, the picture is more encouraging. Most rich people are looking for good investments. If you really think you have a chance of succeeding, you&#39;re doing them a favor by letting them invest. Mixed with any annoyance they might feel about being approached will be the thought: are these guys the next Google?<br />\r\n<br />\r\nUsually angels are financially equivalent to founders. They get the same kind of stock and get diluted the same amount in future rounds. How much stock should they get? That depends on how ambitious you feel. When you offer x percent of your company for y dollars, you&#39;re implicitly claiming a certain value for the whole company. Venture investments are usually described in terms of that number. If you give an investor new shares equal to 5% of those already outstanding in return for $100,000, then you&#39;ve done the deal at a pre-money valuation of $2 million.<br />\r\n<br />\r\nHow do you decide what the value of the company should be? There is no rational way. At this stage the company is just a bet. I didn&#39;t realize that when we were raising money. Julian thought we ought to value the company at several million dollars. I thought it was preposterous to claim that a couple thousand lines of code, which was all we had at the time, were worth several million dollars. Eventually we settled on one millon, because Julian said no one would invest in a company with a valuation any lower. [6]<br />\r\n<br />\r\nWhat I didn&#39;t grasp at the time was that the valuation wasn&#39;t just the value of the code we&#39;d written so far. It was also the value of our ideas, which turned out to be right, and of all the future work we&#39;d do, which turned out to be a lot.<br />\r\n<br />\r\nThe next round of funding is the one in which you might deal with actual&nbsp;<a href="http://paulgraham.com/venturecapital.html">venture capital firms</a>. But don&#39;t wait till you&#39;ve burned through your last round of funding to start approaching them. VCs are slow to make up their minds. They can take months. You don&#39;t want to be running out of money while you&#39;re trying to negotiate with them.<br />\r\n<br />\r\nGetting money from an actual VC firm is a bigger deal than getting money from angels. The amounts of money involved are larger, millions usually. So the deals take longer, dilute you more, and impose more onerous conditions.<br />\r\n<br />\r\nSometimes the VCs want to install a new CEO of their own choosing. Usually the claim is that you need someone mature and experienced, with a business background. Maybe in some cases this is true. And yet Bill Gates was young and inexperienced and had no business background, and he seems to have done ok. Steve Jobs got booted out of his own company by someone mature and experienced, with a business background, who then proceeded to ruin the company. So I think people who are mature and experienced, with a business background, may be overrated. We used to call these guys &quot;newscasters,&quot; because they had neat hair and spoke in deep, confident voices, and generally didn&#39;t know much more than they read on the teleprompter.<br />\r\n<br />\r\nWe talked to a number of VCs, but eventually we ended up financing our startup entirely with angel money. The main reason was that we feared a brand-name VC firm would stick us with a newscaster as part of the deal. That might have been ok if he was content to limit himself to talking to the press, but what if he wanted to have a say in running the company? That would have led to disaster, because our software was so complex. We were a company whose whole m.o. was to win through better technology. The strategic decisions were mostly decisions about technology, and we didn&#39;t need any help with those.<br />\r\n<br />\r\nThis was also one reason we didn&#39;t go public. Back in 1998 our CFO tried to talk me into it. In those days you could go public as a dogfood portal, so as a company with a real product and real revenues, we might have done well. But I feared it would have meant taking on a newscaster-- someone who, as they say, &quot;can talk Wall Street&#39;s language.&quot;<br />\r\n<br />\r\nI&#39;m happy to see Google is bucking that trend. They didn&#39;t talk Wall Street&#39;s language when they did their IPO, and Wall Street didn&#39;t buy. And now Wall Street is collectively kicking itself. They&#39;ll pay attention next time. Wall Street learns new languages fast when money is involved.<br />\r\n<br />\r\nYou have more leverage negotiating with VCs than you realize. The reason is other VCs. I know a number of VCs now, and when you talk to them you realize that it&#39;s a seller&#39;s market. Even now there is too much money chasing too few good deals.<br />\r\n<br />\r\nVCs form a pyramid. At the top are famous ones like Sequoia and Kleiner Perkins, but beneath those are a huge number you&#39;ve never heard of. What they all have in common is that a dollar from them is worth one dollar. Most VCs will tell you that they don&#39;t just provide money, but connections and advice. If you&#39;re talking to Vinod Khosla or John Doerr or Mike Moritz, this is true. But such advice and connections can come very expensive. And as you go down the food chain the VCs get rapidly&nbsp;dumber. A few steps down from the top you&#39;re basically talking to bankers who&#39;ve picked up a few new vocabulary words from reading<em>Wired</em>. (Does your product use&nbsp;<em>XML?</em>) So I&#39;d advise you to be skeptical about claims of experience and connections. Basically, a VC is a source of money. I&#39;d be inclined to go with whoever offered the most money the soonest with the least strings attached.<br />\r\n<br />\r\nYou may wonder how much to tell VCs. And you should, because some of them may one day be funding your competitors. I think the best plan is not to be overtly secretive, but not to tell them everything either. After all, as most VCs say, they&#39;re more interested in the people than the ideas. The main reason they want to talk about your idea is to judge you, not the idea. So as long as you seem like you know what you&#39;re doing, you can probably keep a few things back from them. [7]<br />\r\n<br />\r\nTalk to as many VCs as you can, even if you don&#39;t want their money, because a) they may be on the board of someone who will buy you, and b) if you seem impressive, they&#39;ll be discouraged from investing in your competitors. The most efficient way to reach VCs, especially if you only want them to know about you and don&#39;t want their money, is at the conferences that are occasionally organized for startups to present to them.<br />\r\n<br />\r\n<strong>Not Spending It</strong><br />\r\n<br />\r\nWhen and if you get an infusion of real money from investors, what should you do with it? Not spend it, that&#39;s what. In nearly every startup that fails, the proximate cause is running out of money. Usually there is something deeper wrong. But even a proximate cause of death is worth trying hard to avoid.<br />\r\n<br />\r\nDuring the Bubble many startups tried to &quot;get big fast.&quot; Ideally this meant getting a lot of customers fast. But it was easy for the meaning to slide over into hiring a lot of people fast.<br />\r\n<br />\r\nOf the two versions, the one where you get a lot of customers fast is of course preferable. But even that may be overrated. The idea is to get there first and get all the users, leaving none for competitors. But I think in most businesses the advantages of being first to market are not so overwhelmingly great. Google is again a case in point. When they appeared it seemed as if search was a mature market, dominated by big players who&#39;d spent millions to build their brands: Yahoo, Lycos, Excite, Infoseek, Altavista, Inktomi. Surely 1998 was a little late to arrive at the party.<br />\r\n<br />\r\nBut as the founders of Google knew, brand is worth next to nothing in the search business. You can come along at any point and make something better, and users will gradually seep over to you. As if to emphasize the point, Google never did any advertising. They&#39;re like dealers; they sell the stuff, but they know better than to use it themselves.<br />\r\n<br />\r\nThe competitors Google buried would have done better to spend those millions improving their software. Future startups should learn from that mistake. Unless you&#39;re in a market where products are as undifferentiated as cigarettes or vodka or laundry detergent, spending a lot on brand advertising is a sign of breakage. And few if any Web businesses are so undifferentiated. The dating sites are running big ad campaigns right now, which is all the more evidence they&#39;re ripe for the picking. (Fee, fie, fo, fum, I smell a company run by marketing guys.)<br />\r\n<br />\r\nWe were compelled by circumstances to grow slowly, and in retrospect it was a good thing. The founders all learned to do every job in the company. As well as writing software, I had to do sales and customer support. At sales I was not very good. I was persistent, but I didn&#39;t have the smoothness of a good salesman. My message to potential customers was: you&#39;d be stupid not to sell online, and if you sell online you&#39;d be stupid to use anyone else&#39;s software. Both statements were true, but that&#39;s not the way to convince people.<br />\r\n<br />\r\nI was great at customer support though. Imagine talking to a customer support person who not only knew everything about the product, but would apologize abjectly if there was a bug, and then fix it immediately, while you were on the phone with them. Customers loved us. And we loved them, because when you&#39;re growing slow by word of mouth, your first batch of users are the ones who were smart enough to find you by themselves. There is nothing more valuable, in the early stages of a startup, than smart users. If you listen to them, they&#39;ll tell you exactly how to make a winning product. And not only will they give you this advice for free, they&#39;ll pay you.<br />\r\n<br />\r\nWe officially launched in early 1996. By the end of that year we had about 70 users. Since this was the era of &quot;get big fast,&quot; I worried about how small and obscure we were. But in fact we were doing exactly the right thing. Once you get big (in users or employees) it gets hard to change your product. That year was effectively a laboratory for improving our software. By the end of it, we were so far ahead of our competitors that they never had a hope of catching up. And since all the hackers had spent many hours talking to users, we understood online commerce way better than anyone else.<br />\r\n<br />\r\nThat&#39;s the key to success as a startup. There is nothing more important than understanding your business. You might think that anyone in a business must, ex officio, understand it. Far from it. Google&#39;s secret weapon was simply that they understood search. I was working for Yahoo when Google appeared, and Yahoo didn&#39;t understand search. I know because I once tried to convince the powers that be that we had to make search better, and I got in reply what was then the party line about it: that Yahoo was no longer a mere &quot;search engine.&quot; Search was now only a small percentage of our page views, less than one month&#39;s growth, and now that we were established as a &quot;media company,&quot; or &quot;portal,&quot; or whatever we were, search could safely be allowed to wither and drop off, like an umbilical cord.<br />\r\n<br />\r\nWell, a small fraction of page views they may be, but they are an important fraction, because they are the page views that Web sessions start with. I think Yahoo gets that now.<br />\r\n<br />\r\nGoogle understands a few other things most Web companies still don&#39;t. The most important is that you should put users before advertisers, even though the advertisers are paying and users aren&#39;t. One of my favorite bumper stickers reads &quot;if the people lead, the leaders will follow.&quot; Paraphrased for the Web, this becomes &quot;get all the users, and the advertisers will follow.&quot; More generally, design your product to please users first, and then think about how to make money from it. If you don&#39;t put users first, you leave a gap for competitors who do.<br />\r\n<br />\r\nTo make something users love, you have to understand them. And the bigger you are, the harder that is. So I say &quot;get big slow.&quot; The slower you burn through your funding, the more time you have to learn.<br />\r\n<br />\r\nThe other reason to spend money slowly is to encourage a culture of cheapness. That&#39;s something Yahoo did understand. David Filo&#39;s title was &quot;Chief Yahoo,&quot; but he was proud that his unofficial title was &quot;Cheap Yahoo.&quot; Soon after we arrived at Yahoo, we got an email from Filo, who had been crawling around our directory hierarchy, asking if it was really necessary to store so much of our data on expensive RAID drives. I was impressed by that. Yahoo&#39;s market cap then was already in the billions, and they were still worrying about wasting a few gigs of disk space.<br />\r\n<br />\r\nWhen you get a couple million dollars from a VC firm, you tend to feel rich. It&#39;s important to realize you&#39;re not. A rich company is one with large revenues. This money isn&#39;t revenue. It&#39;s money investors have given you in the hope you&#39;ll be able to generate revenues. So despite those millions in the bank, you&#39;re still poor.<br />\r\n<br />\r\nFor most startups the model should be grad student, not law firm. Aim for cool and cheap, not expensive and impressive. For us the test of whether a startup understood this was whether they had Aeron chairs. The Aeron came out during the Bubble and was very popular with startups. Especially the type, all too common then, that was like a bunch of kids playing house with money supplied by VCs. We had office chairs so cheap that the arms all fell off. This was slightly embarrassing at the time, but in retrospect the grad-studenty atmosphere of our office was another of those things we did right without knowing it.<br />\r\n<br />\r\nOur offices were in a wooden triple-decker in Harvard Square. It had been an apartment until about the 1970s, and there was still a claw-footed bathtub in the bathroom. It must once have been inhabited by someone fairly eccentric, because a lot of the chinks in the walls were stuffed with aluminum foil, as if to protect against cosmic rays. When eminent visitors came to see us, we were a bit sheepish about the low production values. But in fact that place was the perfect space for a startup. We felt like our role was to be impudent underdogs instead of corporate stuffed shirts, and that is exactly the spirit you want.<br />\r\n<br />\r\nAn apartment is also the right kind of place for developing software. Cube farms suck for that, as you&#39;ve probably discovered if you&#39;ve tried it. Ever notice how much easier it is to hack at home than at work? So why not make work more like home?<br />\r\n<br />\r\nWhen you&#39;re looking for space for a startup, don&#39;t feel that it has to look professional. Professional means doing good work, not elevators and glass walls. I&#39;d advise most startups to avoid corporate space at first and just rent an apartment. You want to live at the office in a startup, so why not have a place designed to be lived in as your office?<br />\r\n<br />\r\nBesides being cheaper and better to work in, apartments tend to be in better locations than office buildings. And for a startup location is very important. The key to productivity is for people to come back to work after dinner. Those hours after the phone stops ringing are by far the best for getting work done. Great things happen when a group of employees go out to dinner together, talk over ideas, and then come back to their offices to implement them. So you want to be in a place where there are a lot of restaurants around, not some dreary office park that&#39;s a wasteland after 6:00 PM. Once a company shifts over into the model where everyone drives home to the suburbs for dinner, however late, you&#39;ve lost something extraordinarily valuable. God help you if you actually start in that mode.<br />\r\n<br />\r\nIf I were going to start a startup today, there are only three places I&#39;d consider doing it: on the Red Line near Central, Harvard, or Davis Squares (Kendall is too sterile); in Palo Alto on University or California Aves; and in Berkeley immediately north or south of campus. These are the only places I know that have the right kind of vibe.<br />\r\n<br />\r\nThe most important way to not spend money is by not hiring people. I may be an extremist, but I think hiring people is the worst thing a company can do. To start with, people are a recurring expense, which is the worst kind. They also tend to cause you to grow out of your space, and perhaps even move to the sort of uncool office building that will make your software worse. But worst of all, they slow you down: instead of sticking your head in someone&#39;s office and checking out an idea with them, eight people have to have a meeting about it. So the fewer people you can hire, the better.<br />\r\n<br />\r\nDuring the Bubble a lot of startups had the opposite policy. They wanted to get &quot;staffed up&quot; as soon as possible, as if you couldn&#39;t get anything done unless there was someone with the corresponding job title. That&#39;s big company thinking. Don&#39;t hire people to fill the gaps in some a priori org chart. The only reason to hire someone is to do something you&#39;d like to do but can&#39;t.<br />\r\n<br />\r\nIf hiring unnecessary people is expensive and slows you down, why do nearly all companies do it? I think the main reason is that people like the idea of having a lot of people working for them. This weakness often extends right up to the CEO. If you ever end up running a company, you&#39;ll find the most common question people ask is how many employees you have. This is their way of weighing you. It&#39;s not just random people who ask this; even reporters do. And they&#39;re going to be a lot more impressed if the answer is a thousand than if it&#39;s ten.<br />\r\n<br />\r\nThis is ridiculous, really. If two companies have the same revenues, it&#39;s the one with fewer employees that&#39;s more impressive. When people used to ask me how many people our startup had, and I answered &quot;twenty,&quot; I could see them thinking that we didn&#39;t count for much. I used to want to add &quot;but our main competitor, whose ass we regularly kick, has a hundred and forty, so can we have credit for the larger of the two numbers?&quot;<br />\r\n<br />\r\nAs with office space, the number of your employees is a choice between seeming impressive, and being impressive. Any of you who were&nbsp;<a href="http://paulgraham.com/nerds.html">nerds</a>&nbsp;in high school know about this choice. Keep doing it when you start a company.<br />\r\n<br />\r\n<strong>Should You?</strong><br />\r\n<br />\r\nBut should you start a company? Are you the right sort of person to do it? If you are, is it worth it?<br />\r\n<br />\r\nMore people are the right sort of person to start a startup than realize it. That&#39;s the main reason I wrote this. There could be ten times more startups than there are, and that would probably be a good thing.<br />\r\n<br />\r\nI was, I now realize, exactly the right sort of person to start a startup. But the idea terrified me at first. I was forced into it because I was a&nbsp;<a href="http://paulgraham.com/icad.html">Lisp</a>&nbsp;hacker. The company I&#39;d been consulting for seemed to be running into trouble, and there were not a lot of other companies using Lisp. Since I couldn&#39;t bear the thought of programming in another language (this was 1995, remember, when &quot;another language&quot; meant C++) the only option seemed to be to start a new company using Lisp.<br />\r\n<br />\r\nI realize this sounds far-fetched, but if you&#39;re a Lisp hacker you&#39;ll know what I mean. And if the idea of starting a startup frightened me so much that I only did it out of necessity, there must be a lot of people who would be good at it but who are too intimidated to try.<br />\r\n<br />\r\nSo who should start a startup? Someone who is a good hacker, between about 23 and 38, and who wants to solve the money problem in one shot instead of getting paid gradually over a conventional working life.<br />\r\n<br />\r\nI can&#39;t say precisely what a good hacker is. At a first rate university this might include the top half of computer science majors. Though of course you don&#39;t have to be a CS major to be a hacker; I was a philosophy major in college.<br />\r\n<br />\r\nIt&#39;s hard to tell whether you&#39;re a good hacker, especially when you&#39;re young. Fortunately the process of starting startups tends to select them automatically. What drives people to start startups is (or should be) looking at existing technology and thinking, don&#39;t these guys realize they should be doing x, y, and z? And that&#39;s also a sign that one is a good hacker.<br />\r\n<br />\r\nI put the lower bound at 23 not because there&#39;s something that doesn&#39;t happen to your brain till then, but because you need to see what it&#39;s like in an existing business before you try running your own. The business doesn&#39;t have to be a startup. I spent a year working for a software company to pay off my college loans. It was the worst year of my adult life, but I learned, without realizing it at the time, a lot of valuable lessons about the software business. In this case they were mostly negative lessons: don&#39;t have a lot of meetings; don&#39;t have chunks of code that multiple people own; don&#39;t have a sales guy running the company; don&#39;t make a high-end product; don&#39;t let your code get too big; don&#39;t leave finding bugs to QA people; don&#39;t go too long between releases; don&#39;t isolate developers from users; don&#39;t move from Cambridge to Route 128; and so on. [8] But negative lessons are just as valuable as positive ones. Perhaps even more valuable: it&#39;s hard to repeat a brilliant performance, but it&#39;s straightforward to avoid errors. [9]<br />\r\n<br />\r\nThe other reason it&#39;s hard to start a company before 23 is that people won&#39;t take you seriously. VCs won&#39;t trust you, and will try to reduce you to a mascot as a condition of funding. Customers will worry you&#39;re going to flake out and leave them stranded. Even you yourself, unless you&#39;re very unusual, will feel your age to some degree; you&#39;ll find it awkward to be the boss of someone much older than you, and if you&#39;re 21, hiring only people younger rather limits your options.<br />\r\n<br />\r\nSome people could probably start a company at 18 if they wanted to. Bill Gates was 19 when he and Paul Allen started Microsoft. (Paul Allen was 22, though, and that probably made a difference.) So if you&#39;re thinking, I don&#39;t care what he says, I&#39;m going to start a company now, you may be the sort of person who could get away with it.<br />\r\n<br />\r\nThe other cutoff, 38, has a lot more play in it. One reason I put it there is that I don&#39;t think many people have the physical stamina much past that age. I used to work till 2:00 or 3:00 AM every night, seven days a week. I don&#39;t know if I could do that now.<br />\r\n<br />\r\nAlso, startups are a big risk financially. If you try something that blows up and leaves you broke at 26, big deal; a lot of 26 year olds are broke. By 38 you can&#39;t take so many risks-- especially if you have kids.<br />\r\n<br />\r\nMy final test may be the most restrictive. Do you actually want to start a startup? What it amounts to, economically, is compressing your working life into the smallest possible space. Instead of working at an ordinary rate for 40 years, you work like hell for four. And maybe end up with nothing-- though in that case it probably won&#39;t take four years.<br />\r\n<br />\r\nDuring this time you&#39;ll do little but work, because when you&#39;re not working, your competitors will be. My only leisure activities were running, which I needed to do to keep working anyway, and about fifteen minutes of reading a night. I had a girlfriend for a total of two months during that three year period. Every couple weeks I would take a few hours off to visit a used bookshop or go to a friend&#39;s house for dinner. I went to visit my family twice. Otherwise I just worked.<br />\r\n<br />\r\nWorking was often fun, because the people I worked with were some of my best friends. Sometimes it was even technically interesting. But only about 10% of the time. The best I can say for the other 90% is that some of it is funnier in hindsight than it seemed then. Like the time the power went off in Cambridge for about six hours, and we made the mistake of trying to start a gasoline powered generator inside our offices. I won&#39;t try that again.<br />\r\n<br />\r\nI don&#39;t think the amount of bullshit you have to deal with in a startup is more than you&#39;d endure in an ordinary working life. It&#39;s probably less, in fact; it just seems like a lot because it&#39;s compressed into a short period. So mainly what a startup buys you is time. That&#39;s the way to think about it if you&#39;re trying to decide whether to start one. If you&#39;re the sort of person who would like to solve the money problem once and for all instead of working for a salary for 40 years, then a startup makes sense.<br />\r\n<br />\r\nFor a lot of people the conflict is between startups and graduate school. Grad students are just the age, and just the sort of people, to start software startups. You may worry that if you do you&#39;ll blow your chances of an academic career. But it&#39;s possible to be part of a startup and stay in grad school, especially at first. Two of our three original hackers were in grad school the whole time, and both got their&nbsp;<a href="http://paulgraham.com/tlbphd.html">degrees</a>. There are few sources of energy so powerful as a procrastinating grad student.<br />\r\n<br />\r\nIf you do have to leave grad school, in the worst case it won&#39;t be for too long. If a startup fails, it will probably fail quickly enough that you can return to academic life. And if it succeeds, you may find you no longer have such a burning desire to be an assistant professor.<br />\r\n<br />\r\nIf you want to do it, do it. Starting a startup is not the great mystery it seems from outside. It&#39;s not something you have to know about &quot;business&quot; to do. Build something users love, and spend less than you make. How hard is that?<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<br />\r\n<strong>Notes</strong><br />\r\n<br />\r\n[1] Google&#39;s revenues are about two billion a year, but half comes from ads on other sites.<br />\r\n<br />\r\n[2] One advantage startups have over established companies is that there are no discrimination laws about starting businesses. For example, I would be reluctant to start a startup with a woman who had small children, or was likely to have them soon. But you&#39;re not allowed to ask prospective employees if they plan to have kids soon. Believe it or not, under current US law, you&#39;re not even allowed to discriminate on the basis of intelligence. Whereas when you&#39;re starting a company, you can discriminate on any basis you want about who you start it with.<br />\r\n<br />\r\n[3] Learning to hack is a lot cheaper than business school, because you can do it mostly on your own. For the price of a Linux box, a copy of K&amp;R, and a few hours of advice from your neighbor&#39;s fifteen year old son, you&#39;ll be well on your way.<br />\r\n<br />\r\n[4] Corollary: Avoid starting a startup to sell things to the biggest company of all, the government. Yes, there are lots of opportunities to sell them technology. But let someone else start those startups.<br />\r\n<br />\r\n[5] A friend who started a company in Germany told me they do care about the paperwork there, and that there&#39;s more of it. Which helps explain why there are not more startups in Germany.<br />\r\n<br />\r\n[6] At the seed stage our valuation was in principle $100,000, because Julian got 10% of the company. But this is a very misleading number, because the money was the least important of the things Julian gave us.<br />\r\n<br />\r\n[7] The same goes for companies that seem to want to acquire you. There will be a few that are only pretending to in order to pick your brains. But you can never tell for sure which these are, so the best approach is to seem entirely open, but to fail to mention a few critical technical secrets.<br />\r\n<br />\r\n[8] I was as bad an employee as this place was a company. I apologize to anyone who had to work with me there.<br />\r\n<br />\r\n[9] You could probably write a book about how to succeed in business by doing everything in exactly the opposite way from the DMV.<br />\r\n<br />\r\n<strong>Thanks</strong>&nbsp;to Trevor Blackwell, Sarah Harlin, Jessica Livingston, and Robert Morris for reading drafts of this essay, and to Steve Melendez and Gregory Price for inviting me to speak.</p>\r\n	data:image/jpeg;base64,	want-to-start-a-startup	1	1	2016-07-28 12:08:48.061631	0
